import React from 'react'
import styled from 'styled-components'


const Introduction: React.FC = () => {


  return (
    <StyledDiv>
    <Styledh1> Sam Swift Frontend Developer </Styledh1>
    <br/>
    <Note> I have experience working professionally with <br/>React, Egret, Angular and building Dapps with Ethereum. </Note>
    </StyledDiv>
  )
}
const StyledDiv = styled.div`
    display: flex;
    fl
`

const Styledh1 = styled.h1`
    margin-top: 5%;
`
const Note = styled.p`
    text-size: 17px;
`

export default Introduction
